create or replace view attendance_trans_to_aggregate as select ll.year,ll.month,ll.school_id,hr.school_name, ll.school_latitude,ll.school_longitude,ll.district_id,hr.district_name,ll.district_latitude, ll.district_longitude,ll.block_id,hr.block_name,'NA' as brc_name,ll.block_latitude,ll.block_longitude,ll.cluster_id, hr.cluster_name,hr.crc_name,ll.cluster_latitude,ll.cluster_longitude, cast(ll.present_sum as int) as total_present,cast(ll.working_days as int) as total_working_days,ll.students_count
from (select at.present_sum,at.working_days,at.month,at.year,at.students_count,at.school_id, sg.school_latitude,sg.school_longitude,sg.district_id,sg.district_latitude,sg.district_longitude,sg.block_id,sg.block_latitude,sg.block_longitude, sg.cluster_id,sg.cluster_latitude,sg.cluster_longitude from (select sum(cast((case when day_1=1 then 1 else 0 end + case when day_2=1 then 1 else 0 end + case when day_3=1 then 1 else 0 end + case when day_4=1 then 1 else 0 end + case when day_5=1 then 1 else 0 end + case when day_6=1 then 1 else 0 end + case when day_7=1 then 1 else 0 end + case when day_8=1 then 1 else 0 end + case when day_9=1 then 1 else 0 end + case when day_10=1 then 1 else 0 end + case when day_11=1 then 1 else 0 end + case when day_12=1 then 1 else 0 end + case when day_13=1 then 1 else 0 end + case when day_14=1 then 1 else 0 end + case when day_15=1 then 1 else 0 end + case when day_16=1 then 1 else 0 end + case when day_17=1 then 1 else 0 end + case when day_18=1 then 1 else 0 end + case when day_19=1 then 1 else 0 end + case when day_20=1 then 1 else 0 end + case when day_21=1 then 1 else 0 end + case when day_22=1 then 1 else 0 end + case when day_23=1 then 1 else 0 end + case when day_24=1 then 1 else 0 end + case when day_25=1 then 1 else 0 end + case when day_26=1 then 1 else 0 end + case when day_27=1 then 1 else 0 end + case when day_28=1 then 1 else 0 end + case when day_29=1 then 1 else 0 end + case when day_30=1 then 1 else 0 end + case when day_31=1 then 1 else 0 end) as float)) as present_sum, sum(cast((case when day_1=2 or day_1=1 then 1 else 0 end + case when day_2=2 or day_2=1 then 1 else 0 end + case when day_3=2 or day_3=1 then 1 else 0 end + case when day_4=2 or day_4=1 then 1 else 0 end + case when day_5=2 or day_5=1 then 1 else 0 end + case when day_6=2 or day_6=1 then 1 else 0 end + case when day_7=2 or day_7=1 then 1 else 0 end + case when day_8=2 or day_8=1 then 1 else 0 end + case when day_9=2 or day_9=1 then 1 else 0 end + case when day_10=2 or day_10=1 then 1 else 0 end + case when day_11=2 or day_11=1 then 1 else 0 end + case when day_12=2 or day_12=1 then 1 else 0 end + case when day_13=2 or day_13=1 then 1 else 0 end + case when day_14=2 or day_14=1 then 1 else 0 end + case when day_15=2 or day_15=1 then 1 else 0 end + case when day_16=2 or day_16=1 then 1 else 0 end + case when day_17=2 or day_17=1 then 1 else 0 end + case when day_18=2 or day_18=1 then 1 else 0 end + case when day_19=2 or day_19=1 then 1 else 0 end + case when day_20=2 or day_20=1 then 1 else 0 end + case when day_21=2 or day_21=1 then 1 else 0 end + case when day_22=2 or day_22=1 then 1 else 0 end + case when day_23=2 or day_23=1 then 1 else 0 end + case when day_24=2 or day_24=1 then 1 else 0 end + case when day_25=2 or day_25=1 then 1 else 0 end + case when day_26=2 or day_26=1 then 1 else 0 end + case when day_27=2 or day_27=1 then 1 else 0 end + case when day_28=2 or day_28=1 then 1 else 0 end + case when day_29=2 or day_29=1 then 1 else 0 end + case when day_30=2 or day_30=1 then 1 else 0 end + case when day_31=2 or day_31=1 then 1 else 0 end ) as float)) as working_days ,school_id,month,year,count(distinct(student_id)) as students_count from student_attendance_trans group by school_id,year,month) as at left join school_geo_master as sg on at.school_id=sg.school_id) as ll left join school_hierarchy_details as hr on ll.school_id=hr.school_id;
insert into school_student_total_attendance as a (year,month,school_id,school_name,school_latitude,school_longitude,district_id,district_name,district_latitude,district_longitude, block_id,block_name,brc_name,block_latitude,block_longitude,cluster_id,cluster_name,crc_name,cluster_latitude,cluster_longitude,total_present,total_working_days, students_count) select year,month,school_id,school_name,school_latitude,school_longitude,district_id,district_name,district_latitude,district_longitude, block_id,block_name,brc_name,block_latitude,block_longitude,cluster_id,cluster_name,crc_name,cluster_latitude,cluster_longitude,total_present,total_working_days, students_count from attendance_trans_to_aggregate on conflict (month,year,school_id) do update set year= a.year,month=a.month,school_id=a.school_id,school_name=a.school_name, school_latitude=a.school_latitude,school_longitude=a.school_longitude,district_id=a.district_id, district_name=a.district_name,district_latitude=a.district_latitude,district_longitude=a.district_longitude, block_id=a.block_id,block_name=a.block_name,brc_name=a.brc_name,block_latitude=a.block_latitude, block_longitude=a.block_longitude,cluster_id=a.cluster_id,cluster_name=a.cluster_name,crc_name=a.crc_name, cluster_latitude=a.cluster_latitude,cluster_longitude=a.cluster_longitude,total_present=a.total_present,total_working_days=a.total_working_days, students_count=a.students_count

update log_summary
SET blank_lines = ${text.line.count:minus(${text.line.nonempty.count})}
where filename = '${filename}' and ff_uuid= '${files_uuid}'

UPDATE files_ingestion
SET
	status = '${status:isNull()
						:ifElse(
							${wn_ingestion.status:notNull()
							:ifElse(
								'KO',
								${wait.counter.OK:notNull():and(${wait.counter.OK:gt(0)}):ifElse('OK','KO')}
							)},
							${status}
						)
				}',
	storage_date = ${wn_ingestion.timestamp:isNull():ifElse("null", ${wn_ingestion.timestamp:format("yyyy-MM-dd HH:mm:ss.SSS"):prepend("TIMESTAMP '"):append("'")})},
	storage_name = ${wn_ingestion.filename:isNull():ifElse("null", ${wn_ingestion.filename:prepend("'"):append("'")})}
WHERE ff_uuid = '${files_uuid}';

update log_summary
SET total_records = ${text.line.count:minus(1)}
where filename = '${filename}' and ff_uuid= '${files_uuid}';

UPDATE zip_files_processing
SET status = 'KO'
WHERE ff_uuid = '${source.uuid}';
